import React from 'react'
class Api extends React.Component {
    constructor() {
    super()
    this.state = {
        api: {}
    }
}

    componentDidMount() {
        fetch("/api/predict")
        .then(response => response.json())
        .then(data => this.setState({
            apiData: data
        }))
    }
    render() {
        console.log(this.state.apiData.predicted)
        // console.log(typeof(JSON.parse(this.state.apiData.python)))
        return(

            <div>
               <h2>{this.state.apiData.predicted}</h2>
            </div>
        )
    }

}




export default Api
